import { FieldType } from "./deserialization/FieldType";
import JsonDeserializationHelper from "./deserialization/JsonDeserializationHelper";

export default class Flight {
    readonly day : Date;
    readonly time : string;
    readonly airline : string;
    readonly flightNumber : string;

    constructor(day : Date, time : string, airline : string, flightNumber : string) {
        this.day = day;
        this.time = time;
        this.airline = airline;
        this.flightNumber = flightNumber;
    }

    static deserialize = (json : any) => {
        const day = JsonDeserializationHelper.assertField(json, 'day', FieldType.DATE);
        const time = JsonDeserializationHelper.assertField(json, 'time', FieldType.STRING);
        const airline = JsonDeserializationHelper.assertField(json, 'airline', FieldType.STRING);
        const flightNumber = JsonDeserializationHelper.assertField(json, 'flightNumber', FieldType.STRING);

        return new Flight(day, time, airline, flightNumber);
    }
}
